// Dashboard.js

import React, { useState, useEffect } from 'react';
import axios from 'axios';

const LeetCodeProfile = ({ username }) => {
  const [solvedCount, setSolvedCount] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const url = `http://localhost:3001/scrapeLeetCode/${username}`;
        const response = await axios.get(url);
        console.log(response.data);
        setSolvedCount(response.data.solvedCount);
      } catch (error) {
        console.error('Error:', error.message);
      }
    };

    fetchData();
  }, [username]);

  return (
    <div className="leet-code-profile">
      <h2 className="profile-title">LeetCode Profile for {username}</h2>
      {solvedCount !== null ? (
        <p className="solved-count">Solved Problems: {solvedCount}</p>
      ) : (
        <p className="loading-message">Loading...</p>
      )}
    </div>
  );
};

const CodeChefProfile = ({ username }) => {
    const [solvedCount, setSolvedCount] = useState(null);
  
    useEffect(() => {
      const fetchData = async () => {
        try {
          const url = `http://localhost:3001/scrapeCodeChef/${username}`;
          const response = await axios.get(url);
          console.log(response.data);
          setSolvedCount(response.data.solvedCount);
        } catch (error) {
          console.error('Error:', error.message);
        }
      };
  
      fetchData();
    }, [username]);
  
    return (
      <div className="leet-code-profile">
        <h2 className="profile-title">CodeChef Profile for {username}</h2>
        {solvedCount !== null ? (
          <p className="solved-count">CodeChef rating: {solvedCount}</p>
        ) : (
          <p className="loading-message">Loading...</p>
        )}
      </div>
    );
  };

const Dashboard = () => {
  const leetCodeUsername = 'vishal_2304';
  const codeChefusername = "hariprasad2003"
  return (
    <div className="dashboard-container">
      <h1 className="dashboard-title">Dashboard</h1>
      <LeetCodeProfile username={leetCodeUsername} />
      <CodeChefProfile username={codeChefusername} />
      
    </div>
  );
};

export default Dashboard;
